/**
 * AI Guard Integration Module
 * Bridges the existing AI Guard violation detection system with FounderX v2 platform
 */

import { errorTracker } from './monitoring/error-tracker';
import { secureApiClient } from './secure-api-client';
import { hasPermission, Permissions } from './auth/rbac';

// Import AI Guard components from the root project
import * as path from 'path';
import * as fs from 'fs';

// Import actual AI Guard components
const AI_GUARD_BASE_PATH = '../../../../../';

// Dynamic imports for AI Guard components
async function importAIGuardComponent(componentPath: string) {
  try {
    const fullPath = path.resolve(__dirname, AI_GUARD_BASE_PATH, componentPath);
    if (fs.existsSync(fullPath)) {
      return await import(fullPath);
    }
    throw new Error(`AI Guard component not found: ${fullPath}`);
  } catch (error) {
    console.warn(`Failed to import AI Guard component: ${componentPath}`, error);
    return null;
  }
}

interface ViolationResult {
  id: string;
  type: 'PLACEHOLDER' | 'MOCK' | 'STUB' | 'HARDCODED_CREDENTIAL' | 'SIMULATION';
  severity: 'low' | 'medium' | 'high' | 'critical';
  file: string;
  line: number;
  column: number;
  message: string;
  suggestion: string;
  context: string;
  timestamp: Date;
}

interface ScanOptions {
  includeTests: boolean;
  includeDocs: boolean;
  customPatterns: string[];
  excludePaths: string[];
  maxFileSize: number;
}

interface ScanResult {
  scanId: string;
  status: 'running' | 'completed' | 'failed';
  startTime: Date;
  endTime?: Date;
  totalFiles: number;
  scannedFiles: number;
  violations: ViolationResult[];
  summary: {
    placeholders: number;
    mocks: number;
    stubs: number;
    credentials: number;
    simulations: number;
  };
  complianceScore: number;
}

class AIGuardIntegration {
  private activeScan: ScanResult | null = null;
  private scanHistory: ScanResult[] = [];

  /**
   * Initialize AI Guard integration with FounderX platform
   */

/**
   * Start a comprehensive scan of the codebase
   */
  async startScan(options: Partial<ScanOptions> = {}): Promise<string> {
    if (!hasPermission(Permissions.SECURITY_SCAN)) {
      throw new Error('Insufficient permissions for security scanning');
    }

    const scanId = `scan_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;
    
    const scanResult: ScanResult = {
      scanId,
      status: 'running',
      startTime: new Date(),
      totalFiles: 0,
      scannedFiles: 0,
      violations: [],
      summary: {
        placeholders: 0,
        mocks: 0,
        stubs: 0,
        credentials: 0,
        simulations: 0
      },
      complianceScore: 0
    };

    this.activeScan = scanResult;
    
    try {
      // Execute AI Guard scanning in background
      this.executeScan(scanResult, options);
      
      // Log scan initiation
      await secureApiClient.logAuditEvent({
        action: 'SCAN_INITIATED',
        resource: 'AI_GUARD',
        success: true,
        metadata: { scanId, options }
      });

      return scanId;
      
    } catch (error) {
      scanResult.status = 'failed';
      scanResult.endTime = new Date();
      
      errorTracker.trackError(error instanceof Error ? error : new Error('Scan execution failed'));
      throw error;
    }
  }

  /**
   * Get scan results by ID
   */

/**
   * Get all scan results
   */
  getAllScanResults(): ScanResult[] {
    const results = [...this.scanHistory];
    if (this.activeScan) {
      results.unshift(this.activeScan);
    }
    return results;
  }

  /**
   * Get current compliance score
   */
  getComplianceScore(): number {
    const latestScan = this.activeScan || this.scanHistory[0];
    return latestScan?.complianceScore || 0;
  }

  /**
   * Get violation statistics
   */
  getViolationStats(): { type: string; count: number; severity: string }[] {
    const latestScan = this.activeScan || this.scanHistory[0];
    if (!latestScan) return [];

    const stats: { type: string; count: number; severity: string }[] = [];
    
    Object.entries(latestScan.summary).forEach(([type, count]) => {
      if (count > 0) {
        const severity = this.getTypeSeverity(type as keyof ScanResult['summary']);
        stats.push({
          type: type.charAt(0).toUpperCase() + type.slice(1),
          count,
          severity
        });
      }
    });

    return stats.sort((a, b) => b.count - a.count);
  }

  /**
   * Execute the actual scanning process using real AI Guard components
   */
  private async executeScan(scanResult: ScanResult, options: Partial<ScanOptions>): Promise<void> {
    try {
      const defaultOptions: ScanOptions = {
        includeTests: false,
        includeDocs: false,
        customPatterns: [],
        excludePaths: ['node_modules', '.git', 'dist', 'build'],
        maxFileSize: 1024 * 1024, // 1MB
        ...options
      };

      // Execute real AI Guard scan - no fallbacks in production
      const realViolations = await this.executeRealScan(scanResult, defaultOptions);
      
      if (realViolations) {
        // Use real scan results from AI Guard components
        scanResult.violations = realViolations;
        this.updateSummaryFromViolations(scanResult);
      } else {
        // AI Guard components not available - throw error for production
        throw new Error('AI Guard components not available. Cannot proceed without real violation detection.');
      }
      
      // Calculate compliance score
      scanResult.complianceScore = this.calculateComplianceScore(scanResult);
      
      // Mark scan as completed
      scanResult.status = 'completed';
      scanResult.endTime = new Date();
      
      // Move to history
      this.scanHistory.unshift(scanResult);
      this.activeScan = null;
      
      // Keep only last 10 scans
      if (this.scanHistory.length > 10) {
        this.scanHistory = this.scanHistory.slice(0, 10);
      }

      errorTracker.trackInfo(`AI Guard scan completed: ${scanResult.violations.length} violations found`);
      
    } catch (error) {
      scanResult.status = 'failed';
      scanResult.endTime = new Date();
      throw error;
    }
  }

  /**
   * Execute real AI Guard scan using actual violation detection engines
   */
  private async executeRealScan(scanResult: ScanResult, options: ScanOptions): Promise<ViolationResult[] | null> {
    try {
      // Import real AI Guard violation engine
      const violationEngine = await importAIGuardComponent('src/violationEngine.js');
      const comprehensiveDetector = await importAIGuardComponent('src/enterprise/comprehensive-violation-detection-engine.js');
      
      if (violationEngine && comprehensiveDetector) {
        // Use real violation detection
        const scanPath = process.cwd();
        const violations: ViolationResult[] = [];
        
        // Scan files using real AI Guard engines
        const fileUtils = await importAIGuardComponent('src/fileUtils.js');
        if (fileUtils) {
          const files = await fileUtils.scanDirectory(scanPath, {
            excludePaths: options.excludePaths,
            includeTests: options.includeTests,
            maxFileSize: options.maxFileSize
          });
          
          scanResult.totalFiles = files.length;
          
          for (const file of files) {
            try {
              const fileViolations = await violationEngine.scanFile(file);
              
              // Convert AI Guard violations to our format
              for (const violation of fileViolations) {
                violations.push({
                  id: `real_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,
                  type: this.mapViolationType(violation.type),
                  severity: this.mapSeverity(violation.severity),
                  file: violation.file,
                  line: violation.line,
                  column: violation.column || 1,
                  message: violation.message,
                  suggestion: violation.suggestion || 'Fix this violation',
                  context: violation.context || '',
                  timestamp: new Date()
                });
              }
              
              scanResult.scannedFiles++;
            } catch (fileError) {
              console.warn(`Failed to scan file ${file}:`, fileError);
            }
          }
        }
        
        return violations;
      }
      
      return null;
    } catch (error) {
      errorTracker.trackError(error instanceof Error ? error : new Error('AI Guard scan execution failed'));
      throw new Error(`AI Guard scan failed: ${error instanceof Error ? error.message : 'Unknown error'}`);
    }
  }

  /**
   * Map AI Guard violation types to our interface
   */
  private mapViolationType(aiGuardType: string): ViolationResult['type'] {
    const typeMap: Record<string, ViolationResult['type']> = {
      'placeholder': 'PLACEHOLDER',
      'mock': 'MOCK',
      'stub': 'STUB',
      'hardcoded_credential': 'HARDCODED_CREDENTIAL',
      'simulation': 'SIMULATION',
      'todo': 'PLACEHOLDER',
      'fixme': 'PLACEHOLDER',
      'hack': 'STUB'
    };
    
    return typeMap[aiGuardType.toLowerCase()] || 'PLACEHOLDER';
  }

  /**
   * Map AI Guard severity levels to our interface
   */

/**
   * Update summary counts from violations array
   */
  private updateSummaryFromViolations(scanResult: ScanResult): void {
    scanResult.summary = {
      placeholders: 0,
      mocks: 0,
      stubs: 0,
      credentials: 0,
      simulations: 0
    };

    scanResult.violations.forEach(violation => {
      switch (violation.type) {
        case 'PLACEHOLDER':
          scanResult.summary.placeholders++;
          break;
        case 'MOCK':
          scanResult.summary.mocks++;
          break;
        case 'STUB':
          scanResult.summary.stubs++;
          break;
        case 'HARDCODED_CREDENTIAL':
          scanResult.summary.credentials++;
          break;
        case 'SIMULATION':
          scanResult.summary.simulations++;
          break;
      }
    });
  }


  /**
   * Calculate compliance score based on violations
   */

/**
   * Get severity for violation type
   */
  private getTypeSeverity(type: keyof ScanResult['summary']): string {
    const severityMap = {
      credentials: 'critical',
      simulations: 'high',
      stubs: 'medium',
      mocks: 'low',
      placeholders: 'medium'
    };
    
    return severityMap[type] || 'low';
  }

