import { BaseEntity } from '../entities';

export interface Repository<T extends BaseEntity> {
  findById(id: string): Promise<T | null>;
  findAll(options?: FindOptions): Promise<T[]>;
  findOne(where: Partial<T>): Promise<T | null>;
  findMany(where: Partial<T>, options?: FindOptions): Promise<T[]>;
  create(data: Omit<T, keyof BaseEntity>): Promise<T>;
  update(id: string, data: Partial<Omit<T, keyof BaseEntity>>): Promise<T>;
  delete(id: string): Promise<void>;
  softDelete(id: string): Promise<void>;
  count(where?: Partial<T>): Promise<number>;
  exists(where: Partial<T>): Promise<boolean>;
}

export interface FindOptions {
  limit?: number;
  offset?: number;
  orderBy?: OrderBy[];
  include?: string[];
}

export interface OrderBy {
  field: string;
  direction: 'ASC' | 'DESC';
}

export abstract class BaseRepository<T extends BaseEntity> implements Repository<T> {
  protected abstract tableName: string;

  async findById(id: string): Promise<T | null> {
    try {
      // Execute database query with proper SQL injection protection
      const query = `SELECT * FROM ${this.tableName} WHERE id = ? AND deletedAt IS NULL`;
      const result = await this.executeQuery(query, [id]);
      return result[0] || null;
    } catch (error) {
      throw new DatabaseError(`Failed to find ${this.tableName} by id: ${id}`, error);
    }
  }

  async findAll(options: FindOptions = {}): Promise<T[]> {
    try {
      const { limit = 50, offset = 0, orderBy = [], include = [] } = options;

      let query = `SELECT * FROM ${this.tableName} WHERE deletedAt IS NULL`;

      if (orderBy.length > 0) {
        const orderClauses = orderBy.map(order => `${order.field} ${order.direction}`);
        query += ` ORDER BY ${orderClauses.join(', ')}`;
      }

      query += ` LIMIT ${limit} OFFSET ${offset}`;

      const results = await this.executeQuery(query);

      if (include.length > 0) {
        return await this.includeRelations(results, include);
      }

      return results;
    } catch (error) {
      throw new DatabaseError(`Failed to find all ${this.tableName}`, error);
    }
  }

  async findOne(where: Partial<T>): Promise<T | null> {
    try {
      const whereClause = this.buildWhereClause(where);
      const query = `SELECT * FROM ${this.tableName} WHERE ${whereClause} AND deletedAt IS NULL LIMIT 1`;
      const result = await this.executeQuery(query, Object.values(where));
      return result[0] || null;
    } catch (error) {
      throw new DatabaseError(`Failed to find one ${this.tableName}`, error);
    }
  }

  async findMany(where: Partial<T>, options: FindOptions = {}): Promise<T[]> {
    try {
      const { limit = 50, offset = 0, orderBy = [] } = options;
      const whereClause = this.buildWhereClause(where);

      let query = `SELECT * FROM ${this.tableName} WHERE ${whereClause} AND deletedAt IS NULL`;

      if (orderBy.length > 0) {
        const orderClauses = orderBy.map(order => `${order.field} ${order.direction}`);
        query += ` ORDER BY ${orderClauses.join(', ')}`;
      }

      query += ` LIMIT ${limit} OFFSET ${offset}`;

      return await this.executeQuery(query, Object.values(where));
    } catch (error) {
      throw new DatabaseError(`Failed to find many ${this.tableName}`, error);
    }
  }

  async create(data: Omit<T, keyof BaseEntity>): Promise<T> {
    try {
      const id = this.generateId();
      const now = new Date();

      const entityData = {
        ...data,
        id,
        createdAt: now,
        updatedAt: now,
      };

      const fields = Object.keys(entityData);
      const values = Object.values(entityData);
      const placeholders = fields.map(() => '?').join(', ');

      const query = `INSERT INTO ${this.tableName} (${fields.join(', ')}) VALUES (${placeholders})`;

      await this.executeQuery(query, values);

      const created = await this.findById(id);
      if (!created) {
        throw new Error('Failed to retrieve created entity');
      }

      return created;
    } catch (error) {
      throw new DatabaseError(`Failed to create ${this.tableName}`, error);
    }
  }

  async update(id: string, data: Partial<Omit<T, keyof BaseEntity>>): Promise<T> {
    try {
      const existing = await this.findById(id);
      if (!existing) {
        throw new NotFoundError(`${this.tableName} not found: ${id}`);
      }

      const updateData = {
        ...data,
        updatedAt: new Date(),
      };

      const fields = Object.keys(updateData);
      const values = Object.values(updateData);
      const setClause = fields.map(field => `${field} = ?`).join(', ');

      const query = `UPDATE ${this.tableName} SET ${setClause} WHERE id = ?`;

      await this.executeQuery(query, [...values, id]);

      const updated = await this.findById(id);
      if (!updated) {
        throw new Error('Failed to retrieve updated entity');
      }

      return updated;
    } catch (error) {
      if (error instanceof NotFoundError) {
        throw error;
      }
      throw new DatabaseError(`Failed to update ${this.tableName}: ${id}`, error);
    }
  }

  async delete(id: string): Promise<void> {
    try {
      const existing = await this.findById(id);
      if (!existing) {
        throw new NotFoundError(`${this.tableName} not found: ${id}`);
      }

      const query = `DELETE FROM ${this.tableName} WHERE id = ?`;
      await this.executeQuery(query, [id]);
    } catch (error) {
      if (error instanceof NotFoundError) {
        throw error;
      }
      throw new DatabaseError(`Failed to delete ${this.tableName}: ${id}`, error);
    }
  }

  async softDelete(id: string): Promise<void> {
    try {
      const existing = await this.findById(id);
      if (!existing) {
        throw new NotFoundError(`${this.tableName} not found: ${id}`);
      }

      const query = `UPDATE ${this.tableName} SET deletedAt = ?, updatedAt = ? WHERE id = ?`;
      const now = new Date();
      await this.executeQuery(query, [now, now, id]);
    } catch (error) {
      if (error instanceof NotFoundError) {
        throw error;
      }
      throw new DatabaseError(`Failed to soft delete ${this.tableName}: ${id}`, error);
    }
  }

  async count(where: Partial<T> = {}): Promise<number> {
    try {
      const whereClause = Object.keys(where).length > 0 
        ? this.buildWhereClause(where) + ' AND deletedAt IS NULL'
        : 'deletedAt IS NULL';

      const query = `SELECT COUNT(*) as count FROM ${this.tableName} WHERE ${whereClause}`;
      const result = await this.executeQuery(query, Object.values(where));
      return result[0]?.count || 0;
    } catch (error) {
      throw new DatabaseError(`Failed to count ${this.tableName}`, error);
    }
  }

  async exists(where: Partial<T>): Promise<boolean> {
    try {
      const count = await this.count(where);
      return count > 0;
    } catch (error) {
      throw new DatabaseError(`Failed to check existence in ${this.tableName}`, error);
    }
  }

  protected buildWhereClause(where: Partial<T>): string {
    const fields = Object.keys(where);
    return fields.map(field => `${field} = ?`).join(' AND ');
  }

  protected generateId(): string {
    // Generate UUID v4 compatible identifier for production use
    return `${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;
  }

  protected async executeQuery(query: string, params: any[] = []): Promise<any[]> {
    const dbDriver = this.getDatabaseDriver();

    try {
      const result = await dbDriver.execute(query, params);
      return this.processQueryResult(result, query);
    } catch (error) {
      throw new DatabaseError(`Query execution failed: ${query}`, error);
    }
  }

  private getDatabaseDriver() {
    if (!process.env.DATABASE_URL) {
      throw new DatabaseError('DATABASE_URL environment variable is required');
    }

    const driver = require('@database/driver');
    return driver.createConnection(process.env.DATABASE_URL);
  }

  private processQueryResult(result: any, query: string): any[] {
    if (query.includes('SELECT COUNT(*)')) {
      return [{ count: result.count || 0 }];
    }

    if (query.includes('SELECT')) {
      return Array.isArray(result.rows) ? result.rows : [result];
    }

    return [];
  }

  protected async includeRelations(entities: T[], include: string[]): Promise<T[]> {
    const enrichedEntities = await Promise.all(
      entities.map(async (entity) => {
        const relations = await this.loadEntityRelations(entity, include);
        return { ...entity, ...relations };
      })
    );

    return enrichedEntities;
  }

  private async loadEntityRelations(entity: T, include: string[]): Promise<any> {
    const relations: any = {};

    for (const relationName of include) {
      const relationData = await this.loadRelation(entity, relationName);
      if (relationData) {
        relations[relationName] = relationData;
      }
    }

    return relations;
  }

  private async loadRelation(entity: T, relationName: string): Promise<any> {
    const relationConfig = this.getRelationConfig(relationName);
    if (!relationConfig) {
      throw new ValidationError(`Unknown relation: ${relationName}`);
    }

    const query = `SELECT * FROM ${relationConfig.table} WHERE ${relationConfig.foreignKey} = ?`;
    const result = await this.executeQuery(query, [entity.id]);

    return relationConfig.type === 'one' ? result[0] : result;
  }

  private getRelationConfig(relationName: string) {
    const relations: Record<string, any> = {
      user: { table: 'users', foreignKey: 'userId', type: 'one' },
      workspace: { table: 'workspaces', foreignKey: 'workspaceId', type: 'one' },
      project: { table: 'projects', foreignKey: 'projectId', type: 'one' },
      agent: { table: 'agents', foreignKey: 'agentId', type: 'one' }
    };

    return relations[relationName];
  }
}

export class DatabaseError extends Error {
  constructor(message: string, public readonly cause?: any) {
    super(message);
    this.name = 'DatabaseError';
  }
}

export class NotFoundError extends Error {
  constructor(message: string) {
    super(message);
    this.name = 'NotFoundError';
  }
}

export class ValidationError extends Error {
  constructor(message: string, public readonly field?: string) {
    super(message);
    this.name = 'ValidationError';
  }
}
